  content: 'Trong Sứ Đồ Hành Giả bản điện ảnh, Nữ cảnh sát chìm Đinh Tiểu Gia hay còn gọi là Đinh tỷ (Xa Thi Mạn) nhận được một tin nhắn nặc danh bằng mã Morse, nội dung tin nhắn tự xưng là một cảnh sát chìm với biệt hiệu Blackjack đã mất liên lạc với phía đặc vụ cảnh sát. Đinh Tỷ vội vã báo cáo lên cấp trên là Q-Sir (Ngô Trấn Vũ) và lập tức triển khai nhiệm vụ “tìm kiểm mật vụ”. Đinh Tỷ một lần nữa thâm nhập vào thế giới ngầm để tìm kiếm tung tích của vị cảnh sát chìm đó. Trong suốt quá trình điều tra, cô vô tình bị dẫn dắt đến sòng bạc và phát hiện ra Đàm Hoan Hỷ (Hứa Thiệu Hùng) bị bắn chết năm nào nay đã đột ngột “sống lại”. Đồng thời Sếp Q cũng điều tra được thông tin một tập đoàn thương nghiệp âm thầm nhúng tay vào một phi vụ giao dịch chất cấm tại Brazil. Họ bắt đầu khoanh vùng và thu hẹp phạm vi vị trí của “Blackjack” bao gồm cả những nhân vật bị tình nghi nhúng tay vào vụ giao dịch trên như : Chủ tịch tập đoàn Quách Minh, tên tham mưu quỷ quyệt A Lam (Trương Gia Huy), đồng bọn của A Lam – Thiếu Gia (Cổ Thiên Lạc) và cả tên trùm vừa hồi sinh Đàm Hoan Hỷ... Quá trình điều tra của họ ngày càng phức tạp khi ai ai cũng bắt đầu dấy lên sự nghi ngờ khi có nội gián. Rốt cuộc ai là “Blackjack”?',
