  content: 'Thảm họa y tế xảy ra, đúng vào Tết Nguyên đán và cũng đúng vào mùa cao điểm du lịch tại Trung Quốc. Có lẽ đây là dịp Tết nguyên đán lạ lùng và hằn sâu vào ký ức của mỗi người dân Trung Quốc. Hàng triệu người đang trên đường về quê ăn Tết đã phải thay đổi kế hoạch sau khi virus Covid-19 bùng phát dữ dội tấn công thành phố Vũ Hán, tỉnh Hồ Bắc. Chiếc hộp Pandora ẩn chứa tất cả những điều bất hạnh trên thế gian: tai ương, bệnh tật đã mở ra. Bệnh dịch, sợ hãi, ốm đau cùng ập đến. Nhưng có thể trong đó vẫn còn một thứ nữa. Đó là hy vọng. Chỉ cần tiếp tục hy vọng thì chúng ta sẽ vượt qua được mọi chuyện. Bệnh viện Hỏa Thần Sơn được xây dựng trong 10 ngày. Một y tá trưởng nam, phải truyền dịch cho 150 bệnh nhân trong một ca sáng. Các bác sĩ, y tá đều phải mặc tã giấy để tiết kiệm thời gian và cũng để đỡ tốn bộ đồ bảo hộ giá 300 tệ, đang rất khan hiếm. Các tình nguyện viên, dù bị người thân ngăn cản, vẫn hỗ trợ ngày đêm cho các gia đình bệnh nhân, tiếp nhu yếu phẩm cho các bệnh viện. Ngày lễ tình nhân, thay vì ngồi bên ánh nến và ly rượu vang, có những cặp tình nhân vẫn đang ở trên tuyến đầu của cuộc chiến chống bệnh dịch. Những đám cưới của các cặp uyên ương đã định ngày, đành hoãn, cách ly mỗi người một nơi. Sau lưng tất cả những con người chống chọi với tử thần ấy đều là cha mẹ già, vợ, chồng trẻ và con còn rất nhỏ. Hơn nữa, họ lại là đứa con độc nhất của gia đình. Bộ phim được dựng lại từ các dữ liệu quay trực tiếp 24/7 tại các bệnh viện của Vũ Hán, từ ngày 24/1/2020 của Đài Truyền hình Quốc gia Trung Quốc. Ê kíp sản xuất từ Mỹ đã hỗ trợ toàn bộ phần hậu kỳ và hoàn thành bộ phim với tiến độ thần tốc - 4 ngày. Bộ phim này tri ân các nhân viên sơ cấp cứu, y tá và bác sĩ của các bệnh viện ở Vũ Hán, những người không quản ngày đêm cứu người.',
