  real_name: 'Million Dollar Baby (2004)',
  content: 'Million Dollar Baby thực sự là một bộ phim hay khiến người xem bàng hoàng vì độ chân thực, khốc liệt, gai góc của nó. Nếu bạn thích thể loại phim thể thao, nhưng lại có yêu cầu khắt khe và muốn một tác phẩm có chiều sâu, thì Million Dollar Baby chính là một gợi ý tuyệt vời. Phim mở đầu với hình ảnh Frankie Dunn (Clint Eastwood ) thận trọng đặt miếng gạc vào dưới mắt phải của một võ sĩ ông đang đào tạo. Frankie chỉ bảo cho các võ sĩ cách tấn công và cách bảo vệ mắt khi chiến đấu. Cùng làm việc với Frankie tại phòng tập là Eddie Dupris “Sắt vụn” (Morgan Freeman) nhà vô địch quyền Anh một thời nhưng phải kết thúc sự nghiệp khi ông bị đối thủ “xơi” mất một mắt. Qua câu chuyện của hai cựu võ sĩ, bộ phim hướng vào Maggie Fitzgerald (Hilary Swank), một cô bồi bàn đã 31 tuổi nhưng lại có niềm đam mê với môn quyền Anh. Một ngày, Maggie tìm đến Frankie thỉnh cầu ông huấn luyện cô nhưng ông lạnh lùng nói rằng ông không huấn luyện võ sỹ nữ. Tuy nhiên sau đó, nhìn thấy sự nỗ lực và quyết tâm của cô gái trẻ, chứng kiến việc cô kiên quyết ở lại tập đến 12h đêm mỗi ngày, Frankie đã thay đổi cách nhìn nhận và dần dần dốc hết tâm sức vào cô gái nhỏ đặc biệt của mình. Với sự huấn luyện của Frankie và niềm đam mê cùng sự quyết tâm cao của mình, Maggie đã dần đạt đến đỉnh cao của sự nghiệp… Clint Eastwood là một trong những ngôi sao sáng của điện ảnh Thế giới. Million Dollar Baby do ông đạo diễn có nội dung rất chặt chẽ với đầy đủ cao trào và khoảng lặng. Bên cạnh yếu tố kịch tính, hồi hộp trong những trận đấu quyền Anh, phim còn khá chăm chút về yếu tố tâm lý với nhiều câu thoại ý nghĩa, trường đoạn chậm rãi mô tả tốt nội tâm nhân vật. Về mặt kỹ thuật phim cắt dựng và xây dựng bối cảnh rất tốt, màu sắc phim mịn màng, sử dụng ánh sáng hiệu quả, bố cục có chủ đích và hợp lý. Không chỉ được đánh giá cao trên cương vị đạo diễn với giải Oscar danh giá, Clint Eastwood còn chinh phục người xem bằng diễn xuất rất tốt của mình. Vốn có sẵn gương mặt biểu cảm, hợp với dạng vai nội tâm, trầm lặng. Thêm vào đó, ánh mắt sâu hút và vẻ khắc khổ được thể hiện rất đúng lúc đúng chỗ của ông, càng tăng thêm sức nặng của vai diễn. Bên cạnh đó là màn trình diễn xuất sắc không kém của nữ diễn viên chính Hilary Swank và nam diễn viên phụ Morgan Freeman. Với gương mặt có phần góc cạnh và phong cách quyết liệt, mạnh mẽ, Hilary Swank thuộc kiểu diễn viên khá kén kịch bản. Lần này, việc chọn tham gia Million Dollar Baby có lẽ là một trong những quyết định sáng suốt nhất của nữ diễn viên này. Hilary Swank thể hiện xuất sắc vai diễn càng về sau càng khiến người xem dễ rơi lệ, nhờ đó cô đã dành được giải Oscar cho vai nữ chính xuất sắc nhất. Trong khi đó, diễn viên Morgan Freeman trong vai anh chàng võ sĩ “về hưu” Dupris “Sắt vụn” không có nhiều đất diễn nhưng người xem vẫn có thể nhận ra những nét diễn đặc trưng của ông, ngoài là trợ lý của Frankie, cổ động viên nhiệt tình nhất của Maggie, Dupris còn là người dẫn truyện hóm hỉnh, đầy cảm xúc. Vai diễn này cũng đã đem đến cho ông một tượng vàng Oscar hạng mục nam diễn viên phụ xuất sắc nhất. Million Dollar Baby là câu chuyện mà ẩn đằng sau đó nhiều lớp lang ý nghĩa và thông điệp sâu sắc. Phim ca ngợi ý chí ngoan cường và sức sống mãnh liệt của người phụ nữ, câu chuyện về tình người, tình cảm gia đình. Thêm vào đó, phim còn phản ánh rất nhiều thực tế khắc nghiệt của cuộc sống và bài học về cái giá của vinh quang.​',
